import React from "react";
import Card from "../components/Card";

// TODO get 10 most recent gig cards
const gigs = [
  {
    title: "gig",
    city: "city",
    rate: "rate",
    desc: "desc",
    schedule: "schedule",
    startDate: "startDate",
  },
];

// User can filter gigs by cities: NYC, LA, and Chicago.

function StaffGig() {
  return (
    <div>
      {gigs &&
        gigs.map((gig) => (
          <Card
            title={gig.title}
            city={gig.city}
            desc={gig.desc}
            rate={gig.rate}
            schedule={gig.schedule}
            startDate={gig.startDate}
          />
        ))}
    </div>
  );
}

export default StaffGig;
